\u0075\u0031\u005e\u002e\u005a\u0026\u002e\u0024\u0075\u0022\u0033\u0060\u006c\u002e\u0033\u004b\u007b\u0052\u0030\u007d\u0073\u0026\u0042\u0051\u007c\u0037\u0077\u0077\u0028\u0078\u003f\u0034\u0059\u003e\u0060\u003b\u0077\u0057\u0072\u0077\u0068\u0032\u0041\u004b\u007e\u002a\u0055\u0024\u0049\u003a\u0038\u0051\u005e\u0026\u007e\u0044\u0068\u0062\u005e\u0063\u0062\u0039\u0063\u0073\u002b\u0067\u007b\u0067\u003d\u0026\u0048\u0064\u0074\u0062\u0077\u0077\u0035\u0055\u0026\u0072\u0024\u006f\u0030\u002e\u0056\u003b\u0047\u0039\u0073\u0028\u0078\u0066\u006c\u002a\u0074\u0055\u007b\u0052\u007e\u007a\u0030\u006e\u0022\u002a\u0039\u0035\u0047\u0069\u0068\u002c\u006e\u0024\u0036\u0034\u006d\u002f\u003d\u0026\u0048\u0064\u006a\u0054\u002e\u004a\u0043\u0026\u0034\u0055\u0075\u004e\u0062\u0073\u004b\u0029\u0064\u007d\u004e\u006d\u0042\u0025\u002e\u0078\u007d\u0048\u0041\u0064\u007e\u007a\u0026\u0051\u0022\u002a\u007e\u0023\u0071\u0077\u007b\u0036\u006f\u0048\u0047\u004d\u002e\u007a\u0054\u0026\u0045\u0032\u004a\u006d\u0022\u0050\u007e\u002a\u0028\u0024\u0060\u003a\u007c\u0032\u005e\u0026\u003b\u0044\u006f\u006d\u0072\u0025\u0028\u0078\u0032\u0055\u0065\u002b\u0070\u0028\u003b\u0071\u0046\u0065\u0068\u0062\u0077\u0077\u0032\u0036\u006c\u0055\u0075\u004e\u0062\u0073\u004b\u0029\u0064\u007d\u004e\u006d\u0042\u0025\u002e\u0078\u0070\u0072\u0041\u0064\u0022\u0033\u005a\u0059\u0055\u003f\u0076\u0028\u002f\u004a\u006f\u002c\u0023\u0072\u0062\u0061\u0028\u004a\u0037\u0023\u0028\u004e\u0042\u0028\u0036\u0063\u0028\u0029\u007e\u0035\u003b\u0066\u0026\u0028\u003b\u0071\u003c\u0040\u007b\u0021\u006e\u0063\u0057\u0036\u0034\u0034\u006a\u0078\u007e\u007a\u0074\u005d\u0022\u002a\u0034\u0046\u0035\u0066\u0039\u0036\u0045\u0048\u005e\u0034\u0032\u003b\u003d\u0029\u0075\u002f\u0062\u006a\u003a\u0025\u007a\u002e\u007e\u0042\u0072\u0065\u0038\u0079\u0068\u003b\u0057\u003f\u0076\u0028\u002f\u004a\u005f\u0039\u003a\u0072\u003d\u0049\u0037\u0061\u003d\u0026\u0065\u0072\u003b\u005e\u0060\u0037\u004b\u007e\u005d\u002c\u0065\u0078\u0022\u0033\u004d\u006e\u007d\u0043\u0076\u0028\u0046\u0037\u0066\u002c\u006e\u0024\u0064\u0045\u0051\u002e\u0061\u005d\u007c\u004f\u002b\u0075\u0030\u0060\u006c\u002e\u002c\u007b\u0050\u006c\u0063\u0065\u0036\u0026\u0058\u0048\u0062\u0037\u0066\u0077\u0028\u0078\u0032\u0055\u0065\u002b\u0070\u0028\u003b\u0071\u0046\u0065\u0068\u0062\u0077\u0077\u0032\u0036\u006c\u0055\u0075\u004e\u0049\u0049\u0040\u003b\u0072\u0026\u0052\u0054\u003d\u004a\u007a\u0025\u005f\u0072\u004c\u0064\u0078\u002a\u0065\u0059\u0022\u002a\u0039\u0035\u0037\u0056\u007b\u0036\u006a\u002b\u003c\u0053\u0065\u002f\u003d\u0026\u0048\u0064\u0074\u0062\u0077\u0077\u0035\u0055\u0026\u0072\u0024\u006f\u0030\u002e\u0056\u003b\u0047\u0039\u0073\u0028\u0078\u0066\u006c\u002a\u0022\u0042\u003a\u003c\u004d\u0061\u003d\u0026\u0065\u0072\u003b\u005e\u0060\u0037\u004b\u007e\u005d\u002c\u007c\u0065\u004f\u0033\u004d\u006e\u0057\u003f\u0076\u0028\u006c\u0025\u0061\u007e\u0052\u0048\u0056\u0053\u0075\u0075\u0071\u0023\u0028\u004e\u0042\u0021\u0021\u0063\u005d\u003a\u005f\u0072\u0037\u002b\u0058\u002a\u0077\u0057\u0065\u0032\u0026\u006c\u0067\u004b\u007e\u002a\u0037\u0048\u007b\u004d\u0071\u007a\u006e\u0029\u005f\u0052\u0025\u006c\u0037\u0067\u0065\u007e\u007e\u0042\u0029\u004d\u0076\u002e\u0071\u0023\u0028\u004e\u0042\u0028\u0036\u0063\u0028\u0029\u007e\u0035\u003b\u0066\u0026\u0028\u003b\u0071\u003c\u0040\u007b\u0021\u006e\u0063\u0057\u0036\u0034\u0034\u006a\u0078\u007e\u007a\u0074\u005d\u0067\u004a\u0023\u006c\u0037\u0067\u007d\u0036\u0052\u0048\u0053\u0050\u0073\u0033\u002c\u0051\u0056\u0040\u0030\u0054\u0079\u005f\u003a\u0036\u0066\u0057\u0072\u0055\u004e\u005d\u006a\u0066\u0023\u002c\u0066\u006d\u003a\u0025\u0079\u0057\u0062\u0072\u0063\u0034\u0071\u0033\u0068\u003b\u003a\u0077\u0036\u0028\u003f\u0021\u0062\u0039\u006a\u007b\u0054\u006f\u0030\u002e\u003c\u0029\u0044\u0039\u0026\u0049\u003b\u0069\u0075\u003e\u004d\u0070\u0075\u0031\u0065\u004d\u0067\u0076\u004a\u0039\u006a\u0054\u0036\u0021\u0076\u002c\u006f\u0048\u003a\u003c\u006d\u002f\u003d\u0026\u0068\u002a\u0037\u005e\u005e\u0063\u0073\u0044\u005d\u002c\u0033\u004d\u007e\u007a\u0026\u0051\u0022\u002a\u0039\u0035\u0047\u0069\u0068\u002c\u006e\u0024\u0036\u0034\u0062\u0061\u003d\u0026\u0063\u005d\u003e\u0062\u0077\u0077\u0069\u0069\u007d\u006c\u0079\u003e\u0060\u003b\u006f\u0051\u0065\u0032\u006b\u0035\u0051\u0050\u007e\u002a\u0047\u0024\u007a\u0065\u006c\u004a\u002c\u0047\u0037\u0052\u0025\u006c\u0037\u0067\u007d\u0036\u0052\u0048\u0053\u0050\u0073\u0033\u002c\u0051\u0074\u0048\u003b\u005e\u0079\u005f\u004a\u0074\u004f\u006c\u0070\u004e\u004d\u0033\u007d\u0026\u0045\u002b\u0034\u007e\u0067\u004b\u007e\u002a\u0055\u0024\u0049\u003a\u0038\u0051\u005e\u0026\u007e\u0044\u003b\u005e\u005b\u0021\u0028\u0078\u0024\u0055\u0075\u004e\u0054\u007c\u004d\u0057\u0064\u007d\u0077\u0021\u004b\u004a\u004a\u0074\u004f\u006c\u0053\u0053\u003f\u003b\u0060\u0029\u007e\u006d\u0024\u0049\u0022\u0050\u007e\u002a\u0055\u0024\u0049\u003a\u0038\u0051\u005e\u0026\u007e\u0044\u0068\u0062\u0072\u0025\u0028\u0078\u005b\u0055\u0075\u004e\u0075\u0056\u0022\u0057\u006d\u0051\u0067\u0054\u005a\u0037\u002c\u002c\u0026\u0072\u003a\u003c\u006a\u002a\u0065\u0059\u0022\u002a\u0039\u0035\u0037\u0056\u007b\u0036\u006a\u002b\u003c\u0053\u003d\u0028\u0065\u006e\u0057\u003f\u0076\u0028\u002f\u004a\u006f\u002c\u0023\u0072\u0062\u0061\u0028\u004a\u0037\u0023\u0028\u004e\u0042\u0021\u0021\u0063\u005d\u003a\u005f\u0072\u0037\u002b\u0077\u0033\u006f\u0051\u005b\u0052\u0025\u006c\u0037\u0067\u0051\u002a\u0052\u0048\u002a\u0028\u0037\u0079\u007e\u006e\u0022\u002a\u007e\u0023\u0071\u0077\u007b\u0036\u006f\u0048\u0047\u004d\u003a\u0033\u004f\u0051\u0072\u0077\u0066\u0062\u0062\u005f\u0022\u0079\u004b\u0070\u0075\u0031\u005e\u002e\u005a\u0026\u002e\u0024\u0075\u0022\u0033\u0060\u0044\u0041\u004f\u006c\u007e\u002e\u0056\u007a\u0060\u003b\u0028\u0072\u0074\u0032\u0044\u0060\u006c\u002e\u002c\u007b\u0057\u004d\u003b\u004a\u005e\u0026\u007e\u0044\u0077\u0028\u0072\u0025\u0028\u0078\u003b\u0034\u0034\u0041\u0026\u0028\u003b\u0071\u006c\u004e\u006b\u0054\u003b\u0079\u004d\u0044\u0075\u0070\u0022\u003c\u006d\u002f\u003d\u0026\u0048\u0064\u0074\u0062\u0077\u0077\u0035\u0055\u0026\u0072\u0024\u006f\u0030\u002e\u0056\u003b\u0047\u0039\u0073\u0028\u0078\u0066\u006c\u002a\u007d\u0048\u0043\u0064\u0045\u0077\u0037\u0023\u0028\u004e\u0035\u005e\u0047\u0069\u004e\u007e\u003d\u0024\u007c\u0065\u002b\u003b\u006f\u0051\u0042\u002f\u0022\u006d\u003a\u0025\u007a\u002e\u007e\u0042\u0072\u0065\u0038\u0079\u0068\u003b\u007d\u0043\u0076\u0028\u0046\u0037\u0066\u002c\u006e\u0024\u0064\u0045\u0051\u002e\u0054\u0026\u0067\u0032\u0030\u0054\u0036\u0043\u0030\u0043\u004f\u006c\u0053\u0053\u003f\u003b\u0060\u0029\u007e\u006d\u0024\u0049\u003d\u0025\u0041\u003e\u004d\u0070\u0075\u0031\u005e\u002e\u005a\u0026\u002e\u0024\u0075\u0022\u0033\u0060\u006c\u002e\u0033\u004b\u0067\u0078\u0071\u007a\u0074\u0070\u0056\u0037\u0062\u0037\u005b\u0021\u0026\u006a\u0024\u0055\u0075\u004e\u0032\u0022\u0035\u0047\u0070\u0039\u0073\u0028\u0073\u0037\u004a\u0074\u004f\u006c\u0053\u0053\u0077\u0033\u003a\u0029\u0058\u0048\u0028\u006d\u003a\u0025\u0065\u0068\u0023\u0024\u006a\u0078\u0061\u0061\u005e\u0026\u003a\u0077\u006a\u0054\u003f\u0021\u0028\u0078\u0024\u0055\u0075\u004e\u0062\u0073\u004b\u0029\u0064\u007d\u004e\u006d\u0042\u0025\u002e\u0078\u007a\u006c\u0041\u0064\u003e\u0063\u0037\u0023\u0028\u004e\u0042\u0021\u0021\u0063\u005d\u003a\u005f\u0072\u0037\u002b\u0051\u002e\u004f\u0051\u0038\u0054\u002b\u0075\u007c\u0043\u006c\u002e\u002c\u007b\u0022\u0031\u0071\u007a\u0064\u0044\u004c\u002b\u0037\u006a\u003a\u0025\u0065\u0068\u0023\u0024\u006a\u0078\u0061\u0061\u005e\u0026\u003a\u0077\u002a\u0062\u005b\u0021\u0041\u003e\u004d\u0070\u0075\u0031\u005e\u002e\u005a\u0026\u002e\u0024\u0075\u0022\u0033\u0060\u006c\u002e\u0033\u004b\u007b\u0052\u0030\u007d\u0073\u0026\u0042\u0051\u0022\u006d\u0077\u0077\u0028\u0078\u0077\u0070\u006a\u0059\u0030\u002e\u0028\u0026\u003c\u0037\u006b\u0054\u005f\u004a\u0037\u002a\u004b\u0070\u0075\u0031\u002f\u004d\u0074\u0076\u0072\u0037\u0052\u006d\u003b\u0021\u002b\u0069\u0044\u0055\u004c\u0064\u0071\u007c\u0055\u0023\u0028\u004e\u0042\u0028\u0036\u0063\u0028\u0029\u007e\u0035\u003b\u0066\u0026\u0028\u003b\u0071\u006c\u004e\u006b\u0054\u003b\u0079\u004d\u0044\u0028\u0073\u0075\u004e\u0062\u0073\u004b\u0029\u0064\u007d\u004e\u006d\u0042\u0025\u0079\u0039\u0044\u0055\u0053\u003e\u0043\u0063\u0065\u006e\u0057\u003f\u0076\u0028\u002f\u004a\u006f\u002c\u0023\u0072\u0062\u0061\u0028\u004a\u0037\u0023\u0028\u004e\u0042\u0021\u0021\u0063\u005d\u003a\u005f\u0072\u0037\u002b\u0066\u007a\u006f\u0051\u005b\u0052\u0025\u006c\u0037\u0067\u0065\u007e\u007e\u0042\u0029\u004d\u0076\u002e\u007a\u0026\u005b\u0048\u0030\u0054\u005a\u005f\u0032\u0041\u004f\u006c\u0070\u004e\u004d\u0033\u007d\u0026\u0045\u002b\u0034\u007e\u0067\u004b\u007e\u002a\u0028\u0024\u0060\u003a\u007c\u0032\u005e\u0026\u003b\u0044\u0048\u0028\u005b\u0021\u0062\u0039\u006a\u007b\u0054\u006f\u0030\u002e\u003c\u0029\u0044\u0039\u0026\u0049\u003b\u0069\u0075\u003e\u002a\u0048\u006f\u0066\u0026\u0028\u003b\u0071\u0046\u0065\u0068\u0062\u0077\u0077\u0032\u0036\u006c\u0055\u0075\u004e\u0049\u0049\u0040\u003b\u0072\u0026\u0052\u0054\u003d\u004a\u007a\u0025\u0023\u0072\u004c\u0064\u006c\u0028\u0071\u0023\u0028\u004e\u0042\u0028\u0036\u0063\u0028\u0029\u007e\u0035\u003b\u0066\u0026\u0028\u003b\u0071\u0059\u0026\u004e\u007c\u007d\u0025\u0043\u0026\u007e\u0034\u0059\u0061\u007e\u007a\u0062\u0051\u002c\u0061\u0063\u006c\u0037\u0067\u0051\u002a\u0052\u0048\u002a\u0028\u0037\u0079\u007e\u006e\u0022\u002a\u0034\u0046\u0035\u0066\u0039\u0036\u0045\u0048\u005e\u0034\u0075\u007a\u007a\u0026\u0045\u0032\u0060\u006a\u0022\u0050\u007e\u002a\u0037\u0048\u007b\u004d\u0071\u007a\u006e\u0029\u005f\u0052\u0025\u006c\u0037\u0067\u0065\u007e\u007e\u0042\u0029\u004d\u0076\u002e\u0071\u0023\u0028\u004e\u0042\u0021\u0021\u0063\u005d\u003a\u005f\u0072\u0037\u002b\u007b\u0033\u005e\u0026\u0065\u0032\u0026\u006c\u0067\u004b\u007e\u002a\u0047\u0064\u002b\u0065\u0068\u002e\u0077\u0057\u0028\u0044\u0059\u0054\u004c\u0023\u0066\u004e\u0075\u0073\u0075\u004e\u0062\u0073\u004b\u0029\u0064\u007d\u004e\u006d\u0042\u0025\u002e\u0078\u0070\u0072\u003f\u0064\u0038\u005d\u004d\u006e\u007d\u0043\u0076\u0028\u006c\u0025\u0061\u007e\u0052\u0048\u0056\u0053\u0075\u0075\u0054\u0026\u002f\u0032\u002b\u0075\u007c\u0043\u006c\u002e\u002c\u007b\u0022\u0031\u0071\u007a\u0064\u0044\u004c\u002b\u0037\u006a\u003a\u0025\u0033\u0032\u0061\u0024\u006a\u0078\u0029\u0051\u0023\u0029\u0057\u003f\u0076\u0028\u002f\u004a\u006f\u002c\u0023\u0072\u0062\u0061\u0028\u004a\u0037\u0023\u0028\u004e\u0037\u0062\u0046\u004f\u0065\u002c\u005a\u0048\u007a\u002b\u0071\u007a\u006f\u0051\u0072\u0077\u0068\u0032\u0041\u004b\u007e\u002a\u0028\u0024\u0060\u003a\u007c\u0032\u005e\u0026\u003b\u0044\u004f\u0028\u003f\u0021\u0026\u006a\u004b\u0070\u0075\u0031\u002f\u004d\u0074\u0076\u0072\u0037\u0052\u006d\u003b\u0021\u0060\u007e\u007e\u0042\u003a\u003c\u006d\u002f\u003d\u0026\u0048\u0064\u0074\u0062\u0077\u0077\u0035\u0055\u0026\u0072\u0024\u006f\u0030\u002e\u0051\u0057\u0048\u0075\u0040\u0021\u0072\u0025\u002c\u002a\u007a\u006c\u003a\u0049\u007e\u007a\u0030\u006e\u0022\u002a\u007e\u0023\u0071\u0077\u007b\u0036\u006f\u0048\u0047\u004d\u002e\u007a\u0058\u0026\u0067\u0032\u003e\u0068\u0063\u0021\u006c\u002e\u002c\u007b\u0022\u0031\u0071\u007a\u0064\u0044\u004c\u002b\u0037\u006a\u003a\u0025\u004a\u004a\u006e\u0064\u0049\u006c\u0066\u0033\u003d\u0029\u003b\u0037\u0067\u006d\u005b\u0021\u0041\u003e\u004d\u0070\u0075\u0031\u007c\u0033\u0035\u0047\u0063\u0037\u004f\u0028\u0032\u0063\u0039\u0044\u0044\u0055\u0070\u007a\u0071\u007c\u0055\u0023\u0028\u004e\u0042\u0028\u0036\u0063\u0028\u0029\u007e\u0035\u003b\u0066\u0026\u0028\u003b\u0071\u0052\u007d\u006b\u0054\u002f\u0023\u0052\u007e\u0034\u0055\u005b\u006d\u0064\u0033\u004d\u006e\u0057\u003f\u0076\u0028\u006c\u0025\u0061\u007e\u0052\u0048